    "age_order <- c(\"<1\", \"1–4\", \"5–14\", \"15–24\", \"25–39\", \"40–64\", \"65 & up\")\n",
    "\n",
    "# reshaping\n",
    "\n",
    "dengue_long_age <- dengue_age %>%\n",
    "  pivot_longer(\n",
    "    cols = -AgeGroup,\n",
    "    names_to = c(\"Year\", \"Measure\"),\n",
    "    names_sep = \"_\",\n",
    "    values_to = \"Value\"\n",
    "  ) %>%\n",
    "\n",
    "mutate(Value = as.integer(Value)) %>%\n",
    "\n",
    "  pivot_wider(\n",
    "    names_from = Measure,\n",
    "    values_from = Value\n",
    "  ) %>%\n",
    "\n",
    "  # setting AgeGroup in order\n",
    "  mutate(\n",
    "    AgeGroup = factor(AgeGroup, levels = age_order),\n",
    "    Year = as.character(Year)  \n",
    "  ) %>%\n",
    "  arrange(Year, AgeGroup) %>%\n",
    "\n",
    "  # Reordering columns\n",
    "  select(Year, AgeGroup, Cases, Deaths)"
   ]
